/* BUG-28250 : :    . */
void ulpCOMPEraseHostValueSpaces( SChar *aString )
{
/***********************************************************************
 *
 * Description :
 *      : <>  :    .
 *
 ***********************************************************************/

    SInt i, j;
    SInt sLen;

    if( (aString != NULL) && (aString[0] == ':') )
    {
        sLen = idlOS::strlen( aString );

        // count spaces = i - 1
        for ( i = 1 ; i < sLen ; i++ )
        {
            if ( (aString[i] == ' ') ||
                 (aString[i] == '\t') ||
                 (aString[i] == '\n') )
            {
                // do nothing
            }
            else
            {
                break;
            }
        }
        // shift
        for ( j = i ; j < sLen ; j++ )
        {
            aString[j-i+1] = aString[j];
        }
        aString[j-i+1] = '\0';
    }
    else
    {
        // do nothing
    }
}


/* BUG-28118 : system  .     *
 * 3th. problem :     . */
void ulpCOMPSkipMacroFunc()
{
/***********************************************************************
 *
 * Description :
 *      : Macro   id  (...)    .
 *
 ***********************************************************************/
    SChar sCh;
    idBool sDoBreak;
    idBool sIsQuote;
    idBool sIsDQuote;
    idBool sIsFirst;
    // (  
    UInt   sParenNum;

    sIsFirst     = ID_TRUE;
    sDoBreak     = ID_FALSE;
    sIsQuote     = ID_FALSE;
    sIsDQuote    = ID_FALSE;
    sParenNum    = 0;

    while ( (sCh = yyinput()) != (SChar) EOF )
    {
        WRITECH2BUFCOMP(sCh);
        switch( sCh )
        {
            case ')':
                if ( sIsFirst == ID_TRUE )
                {
                    ulpErrorMgr  sErrorMgr;
                    ulpSetErrorCode( &sErrorMgr,
                                     ulpERR_ABORT_COMP_DEFINE_Unknown_Macro_Error );
                    gUlpCOMPErrCode = ulpGetErrorSTATE( &sErrorMgr );
                    COMPerror( ulpGetErrorMSG(&sErrorMgr) );
                }
                if( (sIsQuote  != ID_TRUE) &&
                    (sIsDQuote != ID_TRUE) )
                {
                    sParenNum--;
                    if( sParenNum <= 0 )
                    {
                        sDoBreak = ID_TRUE;
                    }
                }
                break;
            case '(':
                if( sIsFirst == ID_TRUE )
                {
                    sIsFirst = ID_FALSE;
                }
                if( (sIsQuote  != ID_TRUE) &&
                    (sIsDQuote != ID_TRUE) )
                {
                    sParenNum++;
                }
                break;
            case '\'':
                if ( sIsFirst == ID_TRUE )
                {
                    ulpErrorMgr  sErrorMgr;
                    ulpSetErrorCode( &sErrorMgr,
                                     ulpERR_ABORT_COMP_DEFINE_Unknown_Macro_Error );
                    gUlpCOMPErrCode = ulpGetErrorSTATE( &sErrorMgr );
                    COMPerror( ulpGetErrorMSG(&sErrorMgr) );
                }
                if( sIsDQuote == ID_FALSE )
                {
                    if( sIsQuote == ID_FALSE )
                    {
                        sIsQuote = ID_TRUE;
                    }
                    else
                    {
                        sIsQuote = ID_FALSE;
                    }
                }
                break;
            case '"':
                if ( sIsFirst == ID_TRUE )
                {
                    ulpErrorMgr  sErrorMgr;
                    ulpSetErrorCode( &sErrorMgr,
                                     ulpERR_ABORT_COMP_DEFINE_Unknown_Macro_Error );
                    gUlpCOMPErrCode = ulpGetErrorSTATE( &sErrorMgr );
                    COMPerror( ulpGetErrorMSG(&sErrorMgr) );
                }
                if( sIsQuote == ID_FALSE )
                {
                    if( sIsDQuote == ID_FALSE )
                    {
                        sIsDQuote = ID_TRUE;
                    }
                    else
                    {
                        sIsDQuote = ID_FALSE;
                    }
                }
                break;
            // spaces
            case ' ':
                break;
            case '\t':
                break;
            default:
                if ( sIsFirst == ID_TRUE )
                {
                    ulpErrorMgr  sErrorMgr;
                    ulpSetErrorCode( &sErrorMgr,
                                     ulpERR_ABORT_COMP_DEFINE_Unknown_Macro_Error,
                                     COMPtext
                                   );
                    gUlpCOMPErrCode = ulpGetErrorSTATE( &sErrorMgr );
                    COMPerror( ulpGetErrorMSG(&sErrorMgr) );
                }
                break;
        }

        if( sDoBreak == ID_TRUE )
        {
            break;
        }
    }

    if( sCh ==  EOF )
    {
        if( ( sIsQuote  == ID_TRUE ) ||
            ( sIsDQuote == ID_TRUE ) )
        {
            ulpErrorMgr  sErrorMgr;
            ulpSetErrorCode( &sErrorMgr,
                             ulpERR_ABORT_COMP_DEFINE_FUNC_Unterminated_String_Error );
            gUlpCOMPErrCode = ulpGetErrorSTATE( &sErrorMgr );
            COMPerror( ulpGetErrorMSG(&sErrorMgr) );
        }
        else
        {
            ulpErrorMgr  sErrorMgr;
            ulpSetErrorCode( &sErrorMgr,
                             ulpERR_ABORT_COMP_Paren_Count_Error );
            gUlpCOMPErrCode = ulpGetErrorSTATE( &sErrorMgr );
            COMPerror( ulpGetErrorMSG(&sErrorMgr) );
        }
    }
}


